descriptions.descr:
Skulpturparken Terrakotta består av tre delkompositioner:
1. tolv vridna kolonner i tegel vid t-banans mynning bildar en cirkel kring en rund sockel med ett bronsklot;
2. Tre fristående skulpturer: Adam, Eva och Herkules;
3. fjorton pelare mellan Arrheniuslaboratoriet och Allhuset.
